// router.js
import { createRouter, createWebHistory } from 'vue-router';
import Home from './components/ToDoApp.vue';
import Calendar from './views/Calendar-Site.vuee';


const routes = [
  {
    path: '/components/ToDoApp.vue',
    name: 'Home',
    compnent: Home
  },
  {
    path: '/views/Calendar-Site.vue', 
    name: 'Calendar',
    compnent: Calendar
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes
});

export default router;
